    }

    return (
        <div className={classes.UserItem} onClick={expandInformtion}>
            <Row>
                <Col md={6}>
                    <img src={props.source} alt="user" />
                </Col>
                <Col md={6}>
                    <ul>
                        <li>Name: {props.name}</li>
                        <li>Age: {props.age}</li>
                        <li>Country: {props.country}</li>
                    </ul>
                </Col>
            </Row>
        </div>
    );
};

export default userItem;
